import React, { useState } from "react";
import '../SelectDrop/select.css'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import { ClickAwayListener } from '@mui/base/ClickAwayListener';

const Select = () => {
    const [isOpenSelect, setisOpenSelect] = useState(false);
    const [selectedIndex, setselectedIndex] = useState(0);
    const [selectedItem, setselectedItem] = useState('All Categories');
    const openSelect=()=>{
        setisOpenSelect(!isOpenSelect);
    }
    const closeSelect=(index, name)=>{
        setselectedIndex(index);
        setisOpenSelect(false);
        setselectedItem(name)
    }

    return (
        <ClickAwayListener onClickAway={()=> setisOpenSelect(false)}>
        <div className="selectDropWrapper cursor position-relative">
            <span className="openSelect" onClick={openSelect}>{selectedItem}<KeyboardArrowDownIcon className="arrow"/></span>
            {
                isOpenSelect === true &&
                <div className="selectedDrop">
            <div className="searchField">
                <input type="text" placeholder="Search here...."/>
            </div>
            <ul className="searchResults">
                    <li onClick={() => closeSelect(0,'All Categories')} className={`${selectedIndex===0 ? 'active' :''}`} >All Categories</li>
                    <li onClick={() => closeSelect(1,'New & Featured')} className={`${selectedIndex===1 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(2,'New & Featured')} className={`${selectedIndex===2 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(3,'New & Featured')} className={`${selectedIndex===3 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(4,'New & Featured')} className={`${selectedIndex===4 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(5,'New & Featured')} className={`${selectedIndex===5 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(6,'New & Featured')} className={`${selectedIndex===6 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(7,'New & Featured')} className={`${selectedIndex===7 ? 'active' :''}`}>New & Featured</li>                   
                    <li onClick={() => closeSelect(8,'Tennis')} className={`${selectedIndex===8 ? 'active' :''}`}>Tennis</li>
                    <li onClick={() => closeSelect(9,'Football')} className={`${selectedIndex===9 ? 'active' :''}`}>Football</li>
                    <li onClick={() => closeSelect(10,'Basketball')} className={`${selectedIndex===10 ? 'active' :''}`}>Basketball</li>
                    <li onClick={() => closeSelect(11,'Men')} className={`${selectedIndex===11 ? 'active' :''}`}>Men</li>
                    <li onClick={() => closeSelect(12,'Women')} className={`${selectedIndex===12 ? 'active' :''}`}>Women</li>
                    <li onClick={() => closeSelect(13,'Kids')} className={`${selectedIndex===13 ? 'active' :''}`}>Kids</li>
                    <li onClick={() => closeSelect(14,'Sale')} className={`${selectedIndex===14 ? 'active' :''}`}>Sale</li>
            </ul>
        </div>
            }
        </div>
        </ClickAwayListener>
    )
}
export default Select;
